// bandwidth: 20MHz,   40MHz,   80MHz
// heltf    : HELTF20, HELTF40, HELTF80
class wave_table_class
{
public:
    wave_table_class(const std::string& wave_type, const float ampl)
        : _wave_table(wave_table_len), cur(0)
    {

        // if (wave_type ==  "HELTF40") wave_table_len = symbollen[1];
        // else if (wave_type == "HELTF80") wave_table_len = symbollen[2];

        // compute real wave table with 1.0 amplitude
        
        std::vector<float> real_wave_table(wave_table_len);
        std::vector<float> imag_wave_table(wave_table_len);  
        std::cout << wave_table_len << std::endl;

        if (wave_type == "HELTF20") { // “CONST”
            //add user_phase modification

            //bb
            for (size_t i = 0; i < wave_table_len; i++) {
                // real_wave_table[i] = 1.0;
                real_wave_table[i] = HELTF20_bb_real[i];
                imag_wave_table[i] = HELTF20_bb_imag[i];    
            }
        } else if (wave_type == "HELTF40") { //"SQUARE"
            for (size_t i = 0; i < wave_table_len; i++) {
                // real_wave_table[i] = (i < wave_table_len / 2) ? 0.0 : 1.0;
                real_wave_table[i] = HELTF40_bb_real[i];
                imag_wave_table[i] = HELTF40_bb_imag[i];
            }

        } else if (wave_type == "HELTF80") { // "RAMP"
            for (size_t i = 0; i < wave_table_len; i++) {
                // real_wave_table[i] = 2.0 * i / (wave_table_len - 1) - 1.0;
                real_wave_table[i] = HELTF80_bb_real[i];
                imag_wave_table[i] = HELTF80_bb_imag[i];
            }

        } else if (wave_type == "HELTF160") { //"SINE"
            // static const double tau = 2 * std::acos(-1.0);
            for (size_t i = 0; i < wave_table_len; i++) {
                // real_wave_table[i] = std::sin((tau * i) / wave_table_len);
                real_wave_table[i] = HELTF160_bb_real[i];
                imag_wave_table[i] = HELTF160_bb_imag[i];
            }

        } else
            throw std::runtime_error("unknown waveform type: " + wave_type);

        // compute i and q pairs with 90% offset and scale to amplitude
        for (size_t i = 0; i < wave_table_len; i++) {
            // const size_t q = (i + (3 * wave_table_len) / 4) % wave_table_len;
            _wave_table[i] =
                std::complex<float>(ampl * real_wave_table[i], ampl * imag_wave_table[i]);
                // std::complex<float>(ampl * real_wave_table[i], ampl * real_wave_table[q]);
        }
    }

    inline std::complex<float> operator()()
    {
        if (++cur == wave_table_len) cur = 0;
        return _wave_table[cur];
    }

private:
    std::vector<std::complex<float>> _wave_table;
    size_t cur;
};
